import React from 'react'
import { styles } from '../styles';

const DateFormater =(props) => {
    let date = props.date;
    date = date.split(" ");
    console.log('Splitted Date: ', date)

    const year = date[3];
    const day = date[0];
    const dayNum = date[2];
    const month = date[1];


    return {
        day: day,
        dayNum: dayNum,
        year: year,
        month: month,
    }
}

export const NavBar = (props) => {
    const original_date = props.date.toString()
    const formated_date = <DateFormater date={original_date}/>
    console.log('Date: new: ', formated_date.day);

  return (
    <div style={styles.Container}>
        <h1>{formated_date[1]}</h1>
        <a>Home</a>
        <a>Resume</a>
        <a>Personal Interests</a>
        <div>
            <a>LinkedIn</a>
            <a>GitHub</a>
        </div>
    </div>

  );
};
